module.exports = class ModelNotFoundError extends Error {
    constructor(tenantId, type, modelFilenames, domain) {
        super(`Service model of type '${type}' for tenant ${tenantId} not found on domain ${domain}. Tenant might not be onboarded yet. Searched model files: ${modelFilenames}.`);
        this.code = this.statusCode = 404;
    }
};
